import React, { Component } from 'react';

class CCard extends Component {
  constructor(props) {
    super(props)
    this.state = {}    
  }

  render() {
    console.log('style: ' + this.props.style + ', ');

    return (
    <div style={this.props.style}>{this.props.value}</div>
    )
  }

}

export default CCard;
